#,ifndef,_,GLIBCXX_NO_ASSERT,#,include,<,cassert,>,#,endif,#,include,<,cctype,>,#,include,<,cerrno,>,#,include,<,cfloat,>,#,include,<,ciso646,>,#,include,<,climits,>,#,include,<,clocale,>,#,include,<,cmath,>,#,include,<,csetjmp,>,#,include,<,csignal,>,#,include,<,cstdarg,>,#,include,<,cstddef,>,#,include,<,cstdio,>,#,include,<,cstdlib,>,#,include,<,cstring,>,#,include,<,ctime,>, ,#,if,_,_,cplusplus,>=,201103,L,#,include,<,ccomplex,>,#,include,<,cfenv,>,#,include,<,cinttypes,>,#,include,<,cstdbool,>,#,include,<,cstdint,>,#,include,<,ctgmath,>,#,include,<,cwchar,>,#,include,<,cwctype,>,#,endif ,//,', to maintain relative positions of second index and return an result where the done with .....// write about this question was MONSTERS also write and study about stable sortusing namespace std;
ll f(ll s,ll e,ll n,vector<ll>&v,vector<vector<int>>&dp){    if(v[e]-v[s]<n) return e-s+1;
    if(dp[s][e]!=-1) return dp[s][e];
    ll x = f(s+1,e,n,v,dp);
    ll y = f(s,e-1,n,v,dp);
    return dp[s][e]=max(x,y);
}void solve(){    ll n;
cin>>n;
    unordered_map<ll, ll>mp;
    vector<ll> v;
    for(ll i=0;
i<n;
i++){        ll x;
cin>>x;
        if(mp[x]==0){            v.push_back(x);
        }        mp[x]++;
    }    sort(v.begin(),v.end());
    vector<vector<int>> dp(v.size(),vector<int>(v.size(),-1));
    ll ans = f(0,v.size()-1,n,v,dp);
    cout << ans << endl;
} int main(){        ios::sync_with_stdio(false);
    cin.tie(0);
    ll t;
    cin>>t;
    while(t--){        solve();
    }    return 0;
}

